func TestMesh(t *testing.T) {
	f, err := os.Create("in1.svg")
	if err != nil {
		t.Error(err)
	}
	c := vgsvg.New(600, 600)
	c.SetLineWidth(1)
	path := vg.Path{}
	path.Move(vg.Point{X: vg.Millimeter * vg.Length(in1[0].X-200.0), Y: vg.Millimeter * vg.Length(in1[0].Y+620.0)})
	for _, t := range in1[1:] {
		path.Line(vg.Point{X: vg.Millimeter * vg.Length(t.X-200.0), Y: vg.Millimeter * vg.Length(t.Y+620.0)})
	}
	path.Close()
	c.Stroke(path)
	c.WriteTo(f)
	if err := f.Close(); err != nil {
		t.Error(err)
	}

	s1 := New(in1)
	g := s1.Triangulate()
	if len(g) != len(w1) {
		t.Errorf("in1 mesh returned wrong number of triangles: got %v, want %v", len(g), len(w1))
	}
	for i, v := range w1 {
		for j := 0; j < 3; j++ {
			if notEq(g[i].Point[j].X, v.Point[j].X) || notEq(g[i].Point[j].Y, v.Point[j].Y) {
				t.Errorf("in1 triangle %v,%v error: got {%v,%v}, want {%v,%v}", i, j, g[i].Point[j].X, g[i].Point[j].Y, v.Point[j].X, v.Point[j].Y)
			}
		}
	}

	s2 := New(in2)
	g = s2.Triangulate()
	if len(g) != len(w2) {
		t.Errorf("in2 mesh returned wrong number of triangles: got %v, want %v", len(g), len(w2))
	}
	for i, v := range w2 {
		for j := 0; j < 3; j++ {
			if notEq(g[i].Point[j].X, v.Point[j].X) || notEq(g[i].Point[j].Y, v.Point[j].Y) {
				t.Errorf("in2 triangle %v,%v error: got {%v,%v}, want {%v,%v}", i, j, g[i].Point[j].X, g[i].Point[j].Y, v.Point[j].X, v.Point[j].Y)
			}
		}
	}
}

func notEq(a, b float64) bool {
	return math.Abs(a-b) > Epsilon
}

